import React from  "react";
import "./CONTACTS.css"
import { Accordion, AccordionDetails, AccordionSummary, Typography  } from '@material-ui/core';
import ExpandMoreIcon from '@material-ui/icons/ExpandMore';
import EditIcon from '@material-ui/icons/Edit';
import DeleteIcon from '@material-ui/icons/Delete';

function Contacts(props) {
    const {contactList} = props
    console.log(contactList)

    return (contactList.map((contact, index) => {
        return <Accordion key={index}>
        <AccordionSummary
          expandIcon={<ExpandMoreIcon />}
          aria-controls="panel1a-content"
          id="panel1a-header"
        >
          <Typography><strong>{contact.name}</strong></Typography>
        </AccordionSummary>
        <AccordionDetails className="details">
          <Typography>
            <p><strong>ADDRESS: </strong>{contact.address}</p>
            <p><strong>PHONE NUMBER: </strong>{contact.phoneNumber}</p>
            <p><strong>EMAIL: </strong>{contact.email}</p>
            <p><strong>CONTACT TYPE: </strong>{contact.contactType}</p>
          </Typography>
          <div className="icons">
            <DeleteIcon fontSize="large"></DeleteIcon>
            <EditIcon></EditIcon>
          </div>
        </AccordionDetails>
        </Accordion>

    })

    )
    }




export default Contacts
